(1, 'United Nations Development Programme', 'संयुक्त राष्ट्र विकास कार्यक्रम ', NULL, NULL, NULL, NULL, 'The United Nations Development Programme (UNDP) UNDP is the UN\'s global development network, advocating for change and connecting countries to knowledge, experience and resources to help people build a better life. We are on the ground in 166 countries, working with them on their own solutions to global and national development challenges', 'संयुक्त राष्ट्र विकास कार्यक्रम (यूएनडीपी) यूएनडीपी संयुक्त राष्ट्र का वैश्विक विकास नेटवर्क है, जो लोगों को बेहतर जीवन बनाने में मदद करने के लिए परिवर्तन और देशों को ज्ञान, अनुभव और संसाधनों से जोड़ने की वकालत करता है। हम 166 देशों में जमीन पर हैं, उनके साथ वैश्विक और राष्ट्रीय विकास चुनौतियों के अपने समाधान पर काम कर रहे हैं', 1, '2021-10-13 07:24:55', '2021-11-02 12:57:31'),
(2, 'Propagation in Apple farming:', 'सेब की खेती में प्रसार:', 'images/suvidha/20211018154533.jpg', 'images/suvidha/20211018154533.jpg', 'images/suvidha/20211018154533.jpg', 'images/suvidha/20211018154533.jpg', 'Commercial  Apple propagation is done by budding and tongue grafting methods. The planting material needed in apple farming should be purchased only from the registered nurseries and  care should be taken care while transporting those.', 'वाणिज्यिक सेब का प्रसार नवोदित और जीभ ग्राफ्टिंग विधियों द्वारा किया जाता है। सेब की खेती के लिए आवश्यक रोपण सामग्री केवल पंजीकृत नर्सरी से ही खरीदी जानी चाहिए और उनका परिवहन करते समय सावधानी बरतनी चाहिए।', 0, '2021-10-18 15:45:33', '2021-11-02 12:57:02'),
(3, 'Mango Tree Grafting; Training; Pruning Techniques', 'मैंगो ट्री ग्राफ्टिंग; प्रशिक्षण; प्रूनिंग तकनीक', 'images/suvidha/20211102130318Mango-Orchard..jpg.jpg', 'images/suvidha/20211102130318Grafted-Mango-Plant..jpeg.jpeg', 'images/suvidha/20211102130318Pruned-Mango-Tree..jpg.jpg', 'images/suvidha/20211102130318Pruning-Fruit-Bearing-Trees..jpg.jpg', 'Fruit trees are generally pruned to remove dead or diseased wood, allow more light to penetrate into the leaf canopy, and control the overall tree height to improve harvesting. Pruning mango trees is no exception. Sure, you could let them run amok, but you would need significant space for such a large tree and how on earth would you get to the fruit? So how do you prune a mango tree and when is the best time to prune a mango tree? Read on to learn more. Before Trimming Mango Trees On a cautionary note, mangos contain urushiol, the same chemical that poison ivy, poison oak, and sumac contain. This chemical causes contact dermatitis in some people. Since urushiol is also present in the mango leaves, care should be taken to completely cover exposed body parts when pruning mango trees. Also, if you have a mango that’s in dire need of pruning because it has been left to run amok, say it’s 30 feet (9 m.) or taller, a trained arborist who is licensed and insured should be called upon to do the job. If you decide to do the work yourself, the following information will give you a rudimentary mango pruning guide. Mango Pruning Guide About 25-30% of moderate pruning is done on commercially grown mangos to reduce the canopy height and width of large mango trees. Ideally, the tree will be shaped to have three and not more than four main trunks, have ample interior canopy space, and is 12-15 feet (3.5-4.5 m.) tall. All this is true for the home gardener as well. Moderate, and even severe pruning, will not damage the tree, but it will reduce production for one to several seasons, though is worth it in the long run.', 'फलों के पेड़ों को आम तौर पर मृत या रोगग्रस्त लकड़ी को हटाने के लिए काटा जाता है, अधिक प्रकाश को पत्ती की छतरी में प्रवेश करने की अनुमति देता है, और कटाई में सुधार के लिए समग्र पेड़ की ऊंचाई को नियंत्रित करता है। आम के पेड़ काटना कोई अपवाद नहीं है। ज़रूर, आप उन्हें आपे से बाहर निकलने दे सकते हैं, लेकिन आपको इतने बड़े पेड़ के लिए महत्वपूर्ण स्थान की आवश्यकता होगी और आप पृथ्वी पर फल कैसे प्राप्त करेंगे? तो आप आम के पेड़ की छंटाई कैसे करते हैं और आम के पेड़ को काटने का सबसे अच्छा समय कब है? अधिक जानकारी के लिए पढ़ें। आम के पेड़ों को काटने से पहले सावधानी के तौर पर, आम में यूरुशीओल होता है, वही रसायन जिसमें ज़हर आइवी, ज़हर ओक और सुमेक होता है। यह रसायन कुछ लोगों में संपर्क जिल्द की सूजन का कारण बनता है। चूंकि आम के पत्तों में उरुशीओल भी मौजूद होता है, इसलिए आम के पेड़ों की छंटाई करते समय शरीर के खुले हिस्सों को पूरी तरह से ढकने का ध्यान रखना चाहिए। इसके अलावा, अगर आपके पास एक आम है जिसे काटने की सख्त जरूरत है क्योंकि इसे अमोक चलाने के लिए छोड़ दिया गया है, तो कहें कि यह 30 फीट (9 मीटर) या लंबा है, एक प्रशिक्षित आर्बोरिस्ट जिसे लाइसेंस प्राप्त है और बीमित है उसे काम करने के लिए बुलाया जाना चाहिए . यदि आप स्वयं कार्य करने का निर्णय लेते हैं, तो निम्नलिखित जानकारी आपको एक प्राथमिक आम की छंटाई मार्गदर्शिका प्रदान करेगी। मैंगो प्रूनिंग गाइड आम के बड़े पेड़ों की छत्र की ऊंचाई और चौड़ाई को कम करने के लिए व्यावसायिक रूप से उगाए गए आमों पर लगभग 25-30% मध्यम छंटाई की जाती है। आदर्श रूप से, पेड़ को तीन और चार से अधिक मुख्य चड्डी के आकार का होगा, जिसमें पर्याप्त आंतरिक छत्र स्थान होगा, और यह 12-15 फीट (3.5-4.5 मीटर) लंबा होगा। यह सब माली के लिए भी सच है। मध्यम, और यहां तक ​​​​कि गंभीर छंटाई, पेड़ को नुकसान नहीं पहुंचाएगी, लेकिन यह एक से कई मौसमों के लिए उत्पादन को कम कर देगी, हालांकि लंबे समय में इसके लायक है।', 0, '2021-10-18 15:49:30', '2021-11-02 13:03:18'),
